func TestVerifyFinality(t *testing.T) {
	err := verifyFinality(&update)
	assert.Nil(t, err)
}

func TestVerifyNextSyncCommittee(t *testing.T) {
	err := verifyNextSyncCommittee(&state, &update)
	assert.Nil(t, err)
}

func TestVerifyBlsSignatures(t *testing.T) {
	err := verifyBlsSignatures(&state, &update)
	assert.Nil(t, err)
}

func TestDecodeLightClientVerify(t *testing.T) {
	data, err := hexutil.Decode("")
	assert.Nil(t, err)

	verify, err := decodeLightClientVerify(data)
	assert.Nil(t, err)

	assert.Equal(t, update.attestedHeader, verify.update.attestedHeader)
	assert.Equal(t, update.nextSyncCommittee, verify.update.nextSyncCommittee)
	assert.Equal(t, update.nextSyncCommitteeBranch, verify.update.nextSyncCommitteeBranch)
	assert.Equal(t, update.finalizedHeader, verify.update.finalizedHeader)
	assert.Equal(t, update.finalityBranch, verify.update.finalityBranch)
	assert.Equal(t, update.finalizedExeHeader.Hash(), verify.update.finalizedExeHeader.Hash())
	assert.Equal(t, update.exeFinalityBranch, verify.update.exeFinalityBranch)
	assert.Equal(t, update.syncAggregate, verify.update.syncAggregate)
	assert.Equal(t, update.signatureSlot, verify.update.signatureSlot)
	assert.Equal(t, state, *verify.state)
}
